    [],nt"num_tags": 5,nt"name": "narrative-report-brigantine-national-wildlife-refuge-january-1-1964-december-31-1964",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Brigantine
    NWR outlines Refuge accomplishments during the 1964 calendar year. The report begins
    by summarizing the weather conditions, habitat conditions, water conditions, and
    food and cover conditions during the year. Wildlife- including migratory birds,
    upland game birds, big game animals, furbearers, predators, rodents, mammals, and
    raptors- is also covered. The Refuge development and maintenance section discusses
    physical developments, plantings, collections and receipts, and vegetation control.
    A progress report on field investigations and applied research is also provided.
    The public relations section of the report describes recreational uses, Refuge visitors,
    Refuge participation, hunting, and violations. Items of interest, N-R forms, and
    photographs are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
